import React from "react";
import Header from "../components/Header";
import VideoGenerator from "../components/VideoGenerator";

function Home() {
  return (
    <div className="flex flex-col items-center justify-start px-6 py-10 gap-10">
      <Header />
      <VideoGenerator />
    </div>
  );
}

export default Home;
